            <div class="card">
            <div class="content">
                <h2>T-Lab</h2>
                <h3>LOGIN</h3>
                <p>武村研究室のメンバーはこちらからログインしてください</p>
                <a href="#">login</a>
            </div>
            </div>
            </motion.div>
            </div>
    );
};

export default Loginform;
